const colors = [
  { name: 'green', color: '#80E12A' },
  { name: 'red', color: '#CD1F48' },
  { name: 'yellow', color: '#FFDC3C' },
  { name: 'pink', color: '#FF98FE' },
  { name: 'purple', color: '#960a96' },
  { name: 'orange', color: '#E56D29' },
  { name: 'blue', color: '#0A6EFF' },
];

export default colors;
